import '../data.css';

function Data() {

    const [isData, setData] = useState([])

    useEffect(() => {
        fetch('/api').then(
            res => res.json()
        ).then(data => configureData(data))
    }, [])

    function configureData(data) {
        setData(data)
        console.log(typeof (data))
        console.log(isData)
        setHeader(isData)

    }

    function setHeader(header) {
        console.log("Header", header)
    }

    return (
        <div className="App">
            HI
